import '../styles/progressTree.css';
import sapling from '../images/sapling.png';
import seed from '../images/seed.png';
import tree from '../images/tree.png';
import youngTree from '../images/young_tree.png';

const ProgressTree = ({ stage }) => {
    let treeImage;
    switch (stage) {
        case 'seed':
            treeImage = seed;
            break;
        case 'sapling':
            treeImage = sapling;
            break;
        case 'youngTree':
            treeImage = youngTree;
            break;
        case 'tree':
            treeImage = tree;
            break;
        default:
            treeImage = seed;
    }

